import React, { Component } from 'react'
import './Navbar.css';

export default class Navbar extends Component {
    constructor(props) {
        super(props)

        this.state = {
            registerOpen: false,
            loginOpen: false
        }
    }



    render() {
        return (
            <div className="navbar">
                <div className="">
                    <h1> {`<News Tracking/>`} </h1>
                </div>
                <div className="utils">
                    <p onClick={() => this.setState({ registerOpen: true })}> Register </p>
                    <p onClick={() => this.setState({ loginOpen: true })}> Login </p>
                </div>
            </div>
        )
    }
}
